package com.kodeworks.possy

import com.kodeworks.possy.DemParser._
import com.kodeworks.possy.TestDemParser._
import org.junit.Assert._
import org.junit.Test

import scala.io.{BufferedSource, Codec, Source}

class TestDemParser {
  @Test
  def testRecordTypeA {
    val parsed = parse(recordTypeA, recordTypeAString)
    println(parsed)
    parsed.get
  }

  @Test
  def testRecordTypeBHead {
    val parsed = parse(recordTypeBHead, recordTypeBString)
    println(parsed)
    parsed.get
  }

  @Test
  def testRecordTypeB2 {
    val parsed = parse(recordTypeBTailElevations, recordTypeB2String)
    println(parsed)
    parsed.get
  }

  @Test
  def testRecordTypeBTail {
    val p = parse(recordTypeBTailBak, recordTypeB2String + recordTypeB3String)
    println(p)
    p.get
  }

  @Test
  def testRecordTypeBTailFail {
    val p = parse(recordTypeBTailBak, recordTypeAString)
    println(p)
    assertTrue(p.isInstanceOf[Failure])

    val p2 = parse(recordTypeBTailBak, recordTypeBString)
    println(p2)
    assertTrue(p2.isInstanceOf[Failure])
  }

  @Test
  def testRecordTypeB {
    val p = parse(recordTypeB, recordTypeBString + recordTypeB2String + recordTypeB3String)
    println(p)
    p.get
  }

  @Test
  def testFirstRow {
    val p = parse(dem, firstRow)
    println(p)
    p.get
  }

  @Test
  def testDemParser {
    val f: BufferedSource = Source.fromFile("C:/dev/src/data/dem/7002_2_10m_z33.dem")(Codec.ISO8859)
    val string = f.mkString
    val p = parseDem(string)
    f.close
    println("typeA " + p.typeA)
    println("num typeBs " + p.typeBs.size)
    println("last typeB " + p.typeBs.last)
    assertTrue(p.typeBs.forall(_.elevations.size == p.typeA.numberOfColumns))
  }


  @Test
  def testChunkedDemParser {
    val reader = Source.fromFile("C:/dev/src/data/dem/7002_2_10m_z33.dem")(Codec.ISO8859)
    val start = System.currentTimeMillis
    var last = start
    var i = 0
    val p = reader.grouped(1024).map(grp => {
      val p = parse(record, grp.mkString).get
      if(p.isInstanceOf[RecordTypeBHead]){
        i+=1
        if(i % 100 == 0) {
          println("column " + p.asInstanceOf[RecordTypeBHead].columnNumber + " in " + (System.currentTimeMillis() - last) + " millis, free: " + (Runtime.getRuntime.freeMemory() / 1024L / 1024L )  + " MB")
          last = System.currentTimeMillis()
          if(i % 500 == 0) System.gc()
        }
      }
      p
    }).toList
    val end = System.currentTimeMillis
    println("chunked parse took " + (end - start) + " millis")
    println(p.head)
    reader.close
  }

  @Test
  def testFailingBlock {
    val f: BufferedSource = Source.fromFile("C:/dev/src/data/dem/7002_2_row30-32.txt")(Codec.ISO8859)
    val string = f.mkString
    val p = parse(rep(recordTypeB) ^^ (_.toList), string)
    f.close
    println(p)
    p.get
  }

  @Test
  def testAnyN {
    val s = "     1" //5 space, 1
    val p = DemParser.parse(DemParser.anyN(6), s)
    p.get
  }

  @Test
  def testBlank {
    val p1 = parse(blank6, "      ")
    println(p1)
  }

  @Test
  def testFloat {
    var ps = parse(strictFloatStringN(1), "1")
    ps.get
    var p = parse(strictFloatN(1), "12")
    p.get
    p = parse(strictFloatN(1), "")
    assertTrue(p.isInstanceOf[Failure])
    ps = parse(strictFloatStringN(1), "-")
    println(ps)
    assertTrue(ps.isInstanceOf[Failure])
    p = parse(strictFloatN(3), "1.1")
    p.get
    p = parse(strictFloatN(3), "-11")
    p.get
    ps = parse(strictFloatStringN(3), "1-1")
    println(ps)
    assertTrue(ps.isInstanceOf[Failure])
    p = parse(strictFloatN(4), "-1.1")
    p.get
    p = parse(strictFloatN(4), "1.-1")
    assertTrue(p.isInstanceOf[Failure])

    p = parse(strictFloatN(1, 5), " -11.0")
    p.get
    p = parse(strictFloatN(2, 5), " -11.0")
    assertTrue(p.isInstanceOf[Failure])

    p = parse(float12, "    -241.012")
    p.get
    p = parse(float12, "   -241.012")
    assertTrue(p.isInstanceOf[Failure])
    p = parse(strictFloatN(22), "249800.000000000000000")
    p.get
    p = parse(float24, "  249800.000000000000000")
    p.get
    p = parse(strictFloatN(3), "1.2x")
    println(p)
    p.get
  }

  @Test
  def testInt {
    var p = parse(int6, "      ")
    assertTrue(p.isInstanceOf[Failure])

    p = parse(strictIntN(1, 1), " 2")
    p.get

    p = parse(intN(2), " 2")
    p.get

    p = parse(strictIntN(5, 1), "  6   ")
    assertTrue(p.isInstanceOf[Failure])

    p = parse(int6, "  6   ")
    assertTrue(p.isInstanceOf[Failure])

    p = parse(intN(2), "  3")
    assertTrue(p.isInstanceOf[Failure])

    p = parse(int6, "    -1  ")
    p.get
  }

  @Test
  def testElevationOpt {
    val s = "      "
    val p = parse(elevationOpt, s)
    println(p)
    p.get

    val s2 = "              1234        4141      "
    val p2 = parse(elevationOptsN(6), s2)
    println(p2)
    p2.get
  }
}

